class ToggleLike{constructor(e){this.toggler=e,this.ToggleLike()}ToggleLike(){$(this.toggler).click((function(e){e.preventDefault();let t=this;$.ajax({type:"POST",url:$(t).attr("href")}).done((function(e){let l=parseInt($(t).attr("data-likes"));console.log(l),1==e.data.deleted?l-=1:l+=1,$(t).attr("data-likes",l),e.data.deleted,$(t).html(`${l} Likes`)})).fail((function(e){console.log("error in completing the request")}))}))}}